    return (
      <div className={props.warn ? "warning": "hide"}>
        <h1> Warning! </h1>
      </div>
    );
  }
  
 export default class Page extends React.Component {
    constructor(props) {
      super(props);
      this.state = {data: []}
      this.handleToggleClick = this.handleToggleClick.bind(this);
      this.handleToggleClick1 = this.handleToggleClick1.bind(this);

    }
  
    handleToggleClick=(e)=> {
        e.preventDefault();
        window.location.assign('/admin/Students/');
    }
    handleToggleClick1=(e)=> {
        e.preventDefault();
        window.location.assign('/admin/Grades/');
    }
  
    render() {
        const style=this.state.showWarning ?{display:'none'}:{};
      return (
        <div >
         <Button type="submit" color={"warning"} onClick={this.handleToggleClick} >veiw student </Button>
         <Button type="submit" color={"warning"} onClick={this.handleToggleClick1} >create exam and add Grade </Button>

        </div>
      );
    }
  }
